text:
i stopped reading #fashionmagazines years ago ... for the most part b/c i didn’t believe they represented real women, real issues or even real life - it felt pretentious to flip through overly airbrushed pics of #perfectpeople in impossible poses and even more ridiculous clothes ... 📖
but recently when planning for a long stretch of travel and some built in #selfcare time i picked up a handful once again... mostly because i was inspired and impressed by the december covers - a diverse  representation of beautiful brown women - starting with former #flotus @michelleobama looking fierce and flirty in her mid-40’s in #elle
📖
after reading the article in which she was expertly interviewed by @oprah (pg 190) honesty, i wasn’t gonna read any further, but then i just kept flipping the pages and much to my pleasant surprise i found content i could connect with and even share with my fabulous friends...
📖
@aliciadunams in the wake of the #metoo movement i think you’ll find the 12 women highlighted beginning on pg 163 to be an inspiration for your newest book project 📖
@oneekabotu i had to do a double-take when i saw the ad on pg 105 ... she could have been you ... elegant, regal, bold ... plus check out the #bulgari jewelry article on pg 108
📖
@melissa.steach i can totally see you embracing the sentiments expressed on pg 78 about lux loungewear - all day everyday 📖
@tashaandersonlifestyle you need what’s on pg 118 as a great addition to your growing #jonathanadler collection 📖
@fredachobbs you might want to check out the “competition” on pg 177 ... it’s making me rethink our recent lunch convo 📖
@toccararenee the #fendi model on pg 41 reminds me of you and makes me smile
📖
@shilohstyle i hope the article about “first lady fashion” and her #trifecta team encourages and inspires your dreams 📖
@_izzyyoung i could totally see you as the model in that epic shimmering dress from #versace 📖
@50_shadesof_lavender looking at the fashion sense and confidence of the exquisitely beautiful @khalimaaden the 1st hijab model made me think of your fashion forward instagram posts
📖
•
•
#sanyikaworldwide #becoming #ellemagazine #observations #iambecoming

