@pastormildred virtue flowed out of you in abundance... pst m i can never be the same, i am impacted and imparted for life! everyone on set too!! thank you for pouring out yourself, as you shared your story yesterday. no words... thank you🙏❤ @kingsleypst thank you for sharing @pastormildred with the world, her beauty inside out overflows! awesome!! we can't but have a sequel episode to drink more of this fountain. watch out!

yes we are still cooking and it is getting sweeter! i am super glad i obeyed!!💃💃💃
@yellenad @femiasaju @ibukunasaju @paullynx_music @david.h.styles this can not suffice... but 'thank you' for yesterday. 
@pshegz thank you for giving me the wings to fly. you are one in a million! i love you!!😍 crucial conversations- the strong woman series premieres friday 4th january 2019. hooray!!!🥂🍾💃🤸‍♀️🤸‍♂️🎉🎊 #hillcityng #crucialconversations #strongwomanseries #womantowoman #hearttoheart #inspiration #metoo #virtuouswoman #relentless #graced #loved #ucantoo 📸: @femimicheal

